meta.dataGenCode:

$Candles {
            name=Ape Tether US Binance | data=@(APEUSDT, 1h, 1000)
        }
        + PriceLabels {
            name=PriceLabels |
            settings = {zIndex: 1} |
            data = (async () => {
                let rrr = await rsi(close, 14)
                let out = []
                let pos = 0
                for (var i = 0; i < close.length; i++) {
                    if (rrr[i - 14] < 20 && pos < 2) {
                        out.push([time[i], {
                            text: 'Buy',
                            pin: 'low',
                            color: '#41a376',
                            stroke: '#41a376',
                            dir: 1
                        }])
                        pos++
                    } else if (rrr[i - 14] > 70 && pos > 0) {
                        out.push([time[i], {
                            text: 'Sell',
                            pin: 'high',
                            color: '#de4646',
                            stroke: '#de4646',
                            dir: -1
                        }])
                        pos = 0
                    }
                }
                return {out, timify: false}
            })()

        };
